import React from "react";
import EduItem from "./EduItem";
const edus = [
  {
    title: "Flatiron School",
    start: "January 2021",
    end: "April 2021",
    additional: "",
  },
  {
    title: "Montclair State University",
    start: "January 2021",
    end: "April 2021",
    additional: "",
  },
  {
    title: "Kean University",
    start: "January 2021",
    end: "April 2021",
    additional: "",
  },
];

function Education() {
  return (
    <div id="education-section" className="section">
      <h4>Education</h4>
      {edus.map((e) => {
        return <EduItem education={e} />;
      })}
    </div>
  );
}

export default Education;
